CREATE TABLE `stock_stock` (
  `stockId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '库存ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `supplierId` bigint(20) DEFAULT NULL COMMENT '供应商ID',
  `inStockDetailId` bigint(20) DEFAULT NULL COMMENT '入库详单ID',
  `goodsShelvesId` bigint(20) DEFAULT NULL COMMENT '货架ID',
  `sparePartId` bigint(20) NOT NULL COMMENT '备件ID',
  `inDate` datetime DEFAULT NULL COMMENT '入库日期',
  `equipmentNO` varchar(64) DEFAULT NULL COMMENT '设备编号',
  `equipmentName` varchar(128) DEFAULT NULL COMMENT '设备名称',
  `specification` varchar(128) DEFAULT NULL COMMENT '规格型号',
  `category` varchar(128) DEFAULT NULL COMMENT '物品类别',
  `qrCode` varchar(128) DEFAULT NULL COMMENT '系统二维码号',
  `serialNumber` varchar(128) DEFAULT NULL COMMENT '设备序列号',
  `account` int(11) DEFAULT NULL COMMENT '库存总数量',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `inventoryType` varchar(32) DEFAULT NULL COMMENT '库存类型',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `status` varchar(32) DEFAULT NULL COMMENT '设备状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `spareField1` varchar(512) DEFAULT NULL COMMENT '备用字段1',
  `spareField2` varchar(512) DEFAULT NULL COMMENT '备用字段2',
  `spareField3` varchar(512) DEFAULT NULL COMMENT '备用字段3',
  `spareField4` varchar(512) DEFAULT NULL COMMENT '备用字段4',
  `spareField5` varchar(512) DEFAULT NULL COMMENT '备用字段5',
  `spareField6` varchar(512) DEFAULT NULL COMMENT '备用字段6',
  `spareField7` varchar(512) DEFAULT NULL COMMENT '备用字段7',
  `spareField8` varchar(512) DEFAULT NULL COMMENT '备用字段8',
  `spareField9` varchar(512) DEFAULT NULL COMMENT '备用字段9',
  `spareField10` varchar(512) DEFAULT NULL COMMENT '备用字段10',
  `warehouseId` bigint(20) DEFAULT NULL COMMENT '仓库ID',
  PRIMARY KEY (`stockId`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8;
